@ghost_glass_official x @wickedglass x @babedrienne carved Shipwreck Kraken!!!! I’ve been absolutely dying to show this one off! It’s been top secret for a bit. 🤫☠️🦑 I’m in love with how the carved skeleton looks with @ghost_glass_official badass bony armor on @wickedglass elegant AF Kraken. Straight up dream collab piece! 🤩 I’m so so honored to have another chance to work with @wickedglass and to have a first collab with @ghost_glass_official !!! Florida crew represent! In addition to carving the Kraken’s skeleton, I carved in a shipwreck scene in the belly. This one already found its home with our good friends @surf_terp_dab 🦑☠️⛵️ It’s a birthday present from dad to his ultra-badass daughter 🎁 Sold through @52nd_glass_shop 🙏🏼☠️🦑 More photos and videos of this piece and it’s creation to come... •
