Incredible collaborative Wu-Tang bowl piece made by: 
@krznski 
@boroman_glass 
@torontoflameworking 🐥
Colours:
Wu-Tang Spiral
14mm Single Hole
🦉
This bowl is an absolute must have for any Wu-Tang fan out there, even if you’re just a fan of hip hop culture in general, this bowl needs to be part of your collection. We love the spiral work done all across this bowl, gives the bowl it’s own unique look. The little uzi made by @torontoflameworking in the @krznski signature mitts is absolutely sick, and gives it that true hip hop vibe. Black and yellow, can’t get more badass than that.
🐙
